import React from 'react';

export default function Dashboard() {
	return (
		// <div className='max-w-md bg-white rounded-xl shadow-md overflow-hidden md:max-w-2xl mt-10 w-1/3'>
			<div className='flex flex-col max-w-max w-1/4'>
			<div className='md:flex'>
				<div className='md:flex-shrink-0'></div>
				<div class='p-8'>
					<div class='uppercase tracking-wide text-sm text-indigo-500 font-semibold'>
						Case study
					</div>
					<p class='block mt-1 text-lg leading-tight font-medium text-black hover:underline'>
						Finding customers for your new business
					</p>
					<p class='mt-2 text-gray-500'>
						Getting a new business off the ground is a lot of hard work. Here
						are five ideas you can use to find your first customers.
					</p>
				</div>
			</div>
		</div>
	);
}
